import React from 'react'
import styles from './Menu.module.css'


function Menu() {

    return (
        <div className={styles.Menu}>
            <div className={styles.imgMenu}>
                <img src="./imagenes/consulta.png" alt="Img consulta" />
            </div>
            <h1> kira kira</h1>
        </div>
    )
}

export default Menu
